import React from "react";
import "./Quiz.css";
import QuizHomepage from "./quizHomepage";
import QuizContact from "./quizContact";

function Quiz(){
    return <>
        <div className="quiz-page">
        <QuizHomepage />
        <QuizContact />
        </div>
    </>
}

export default Quiz;
